import { StyleSheet } from "react-native";
const stylesNw = StyleSheet.create({
  container: {
    marginTop: 25,
    flexDirection: "column",
    display: "flex",
    backgroundColor: "#FFC232",
  },
  cardProduto: {
    justifyContent: "space-between",
    backgroundColor: "#FF7070",
    flexDirection: "row",
    alignItems: "center",

    marginHorizontal: 5,
    paddingVertical: 15,
    marginVertical: 5,
    borderRadius: 20,
    paddingLeft: 15,
    height: 100,
    zIndex: 0,
    display: "flex",
  },

  cardText: {
    fontWeight: 3,
    fontStyle: "normal",
    color: "#fff",
  },
  cardImage: {
    resizeMode: "cover",
    borderTopLeftRadius: 100,
    borderBottomLeftRadius: 100,
    borderTopRightRadius: 20,
    borderBottomRightRadius: 20,
    height: 100,
    width: 200,
    zIndex: 1,
  },
});
export { stylesNw };
